A classic problem!

Here's the solution:

**Iterative Approach**
```
void reverseLinkedList(Node* head) {
    Node* prev = NULL;
    Node* current = head;
    Node* next = NULL;

    while (current != NULL) {
        next = current->next;
        current->next = prev;
        prev = current;
        current = next;
    }

    head = prev; // update the head pointer
}
```
**Recursive Approach**
```
void reverseLinkedList(Node* head) {
    if (head == NULL || head->next == NULL) {
        return;
    }

    Node* newHead = reverseLinkedList(head->next);
    head->next->next = head;
    head->next = NULL;

    return newHead;
}
```
**Explanation**

In both approaches, we need to keep track of three pointers: `prev`, `current`, and `next`. We iterate through the linked list, and for each node, we:

1. Store the next node in `next`.
2. Reverse the `next` pointer of the current node to point to `prev`.
3. Move `prev` and `current` one step forward.

In the iterative approach, we update the `head` pointer at the end to point to the new head of the reversed list.

In the recursive approach, we recursively call the function on the next node, and then reverse the pointers accordingly. The base case is when the input list has only one node or is empty.

**Time Complexity**

Both approaches have a time complexity of O(n), where n is the number of nodes in the linked list.

**Space Complexity**

The iterative approach has a space complexity of O(1), as we only use a few extra pointers. The recursive approach has a space complexity of O(n), due to the recursive function calls.

