Here is an outline of how you can develop a web-based application that sorts images according to category:

**Technologies Needed:**

* Front-end framework: React, and CSS for building the user interface
* Back-end framework: Node.js with Express.js for creating RESTful APIs
* Database: MongoDB for storing image data
* Image processing library: TensorFlow.js or OpenCV.js for categorizing images

**Step 1: Set up the Project Structure**

Create a new project folder and set up the following structure:
```
project/
client/ (front-end)
components/
ImageGallery.js
ImageCard.js
...
index.js
styles.css
package.json
server/ (back-end)
models/
image.model.js
...
routes/
images.route.js
...
app.js
package.json
database/ ( MongoDB database)
images.db
...
```
**Step 2: Create the Database**

Create a MongoDB database and define a schema for storing image data. The schema should include fields such as `image_url`, `category`, and any other relevant metadata.

**Step 3: Develop the Back-end API**

Create RESTful APIs using Node.js and Express.js to interact with the MongoDB database. Define endpoints for:

* Uploading images
* Retrieving all images
* Retrieving images by category

For example, you can create an `images.route.js` file with the following code:
```
const express = require('express');
const router = express.Router();
const ImageModel = require('../models/image.model');

router.post('/upload', async (req, res) => {
  const image = new ImageModel(req.body);
  try {
    await image.save();
    res.status(201).send({ message: 'Image uploaded successfully' });
  } catch (error) {
    console.error(error);
    res.status(500).send({ message: 'Error uploading image' });
  }
});

router.get('/', async (req, res) => {
  try {
    const images = await ImageModel.find().exec();
    res.send(images);
  } catch (error) {
    console.error(error);
    res.status(500).send({ message: 'Error retrieving images' });
  }
});

router.get('/category/:category', async (req, res) => {
  try {
    const category = req.params.category;
    const images = await ImageModel.find({ category }).exec();
    res.send(images);
  } catch (error) {
    console.error(error);
    res.status(500).send({ message: 'Error retrieving images by category' });
  }
});

module.exports = router;
```
**Step 4: Develop the Front-end Application**

Create a React application using `create-react-app` and install required dependencies such as `axios` for making API requests.

Develop components for:

* Image gallery
* Image card

Use CSS to style the components.

For example, you can create an `ImageGallery.js` component with the following code:
```
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ImageCard from './ImageCard';

const ImageGallery = () => {
  const [images, setImages] = useState([]);
  const [category, setCategory] = useState('');

  useEffect(() => {
    axios.get('/api/images')
      .then(response => {
        setImages(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleCategoryChange = (event) => {
    setCategory(event.target.value);
  };

  const filteredImages = images.filter((image) => image.category === category);

  return (
    <div>
      <h1>Image Gallery</h1>
      <select value={category} onChange={handleCategoryChange}>
        <option value="">All Categories</option>
        <option value="animals">Animals</option>
        <option value="landscapes">Landscapes</option>
        <option value="portraits">Portraits</option>
      </select>
      {filteredImages.map((image) => (
        <ImageCard key={image._id} image={image} />
      ))}
    </div>
  );
};

export default ImageGallery;
```
**Step 5: Integrate Image Processing Library**

Integrate an image processing library such as TensorFlow.js or OpenCV.js to categorize images. You can create a separate API endpoint for categorizing images and use the library to analyze the uploaded images.

For example, you can create a `categorizeImage` function in your back-end API:
```
const tf = require('@tensorflow/tfjs');

const categorizeImage = async (imageData) => {
  const imageTensor = tf.tensor3d(imageData);
  const model = await tf.loadLayersModel('https://storage.googleapis.com/tfjs-models/tfjs/image_classification_mobilenet_v2_1.0_224.tflite');
  const output = model.predict(imageTensor);
  const category = output.dataSync()[0];
  return category;
};
```
**Step 6: Deploy the Application**

Deploy the application to a cloud platform such as Vercel or Netlify.

That's it! You now have a web-based application that sorts images according to category.

